import{_ as e,D as i,H as t,aj as s}from"./chunks/framework.CDxiXvCm.js";const k=JSON.parse('{"title":"Next Admin 组件统计","description":"","frontmatter":{},"headers":[],"relativePath":"work/90.next-admin-search.md","filePath":"work/90.next-admin-search.md","lastUpdated":1769668898000}'),o={name:"work/90.next-admin-search.md"};function l(d,a,n,p,r,h){return i(),t("div",null,a[0]||(a[0]=[s('<div class="info custom-block"><p class="custom-block-title">作者</p><p>novlan1</p><p>2025.9.28</p></div><h1 id="next-admin-组件统计" tabindex="-1">Next Admin 组件统计 <a class="header-anchor" href="#next-admin-组件统计" aria-label="Permalink to &quot;Next Admin 组件统计&quot;">​</a></h1><p>地址：<a href="https://novlan1.github.io/docs/next-admin/component-statistics" target="_blank" rel="noreferrer">https://novlan1.github.io/docs/next-admin/component-statistics</a></p><h2 id="_1-搜索语法" tabindex="-1">1. 搜索语法 <a class="header-anchor" href="#_1-搜索语法" aria-label="Permalink to &quot;1. 搜索语法&quot;">​</a></h2><p>简单搜索，直接输入想搜的内容即可，如：</p><img src="https://mike-1255355338.cos.ap-guangzhou.myqcloud.com/article/2025/9/own_mike_zst6QiC2sMKAay22.png" width="600"><p>高级搜索，可以按字段搜索：</p><ul><li>搜索某组件库，如想搜素 <code>Press UI</code> 组件库，可以输入 <code>library:press-ui</code></li><li>搜索某项目，如想搜素 <code>gp-next</code> 项目，可以输入 <code>project:gp-next</code></li><li>搜索某组件，如想搜素 <code>press-list</code> 组件，可以输入 <code>component:press-list</code></li><li>多个字段搜索，可以使用分号连接，如 <code>library:press-ui;project:gp-next</code>，表示搜索使用 <code>press-ui</code> 组件库的 <code>gp-next</code> 项目</li></ul><img src="https://mike-1255355338.cos.ap-guangzhou.myqcloud.com/article/2025/9/own_mike_2B8BwGWmmJjssJdm.png" width="600"><h2 id="_2-聚合" tabindex="-1">2. 聚合 <a class="header-anchor" href="#_2-聚合" aria-label="Permalink to &quot;2. 聚合&quot;">​</a></h2><p>支持根据组件库、组件、项目维度进行聚合。</p><table tabindex="0"><thead><tr><th>选项</th><th>观察目标</th></tr></thead><tbody><tr><td>组件库</td><td>每个组件库的被引用数</td></tr><tr><td>组件库、组件</td><td>每个组件的被引用数</td></tr><tr><td>组件库、项目</td><td>每个项目对不同组件库的引用数</td></tr><tr><td>组件库、组件、项目</td><td>每个项目对不同组件的引用数</td></tr><tr><td>项目</td><td>每个项目对所有组件的引用数</td></tr></tbody></table><h2 id="_3-堆叠折线图" tabindex="-1">3. 堆叠折线图 <a class="header-anchor" href="#_3-堆叠折线图" aria-label="Permalink to &quot;3. 堆叠折线图&quot;">​</a></h2><p>可观察每个组件库每天的被引用总数，可横向对比不同组件库，也可纵向对比不同时间段的被引用趋势。</p><h2 id="_4-统计意义" tabindex="-1">4. 统计意义 <a class="header-anchor" href="#_4-统计意义" aria-label="Permalink to &quot;4. 统计意义&quot;">​</a></h2><p>组件复用率越高，证明组件库的质量越高，通用性越强，稳定性越好，影响力越大。</p><p>提高组件复用率：</p><ul><li>对开发人员来说，可以减少重复开发，提高开发效率</li><li>对项目来说，既可以缩短工时，也可以提高项目质量</li></ul><p>统计和量化组件复用率，有利于对组件使用情况进行横向和纵向比较，直观、清晰，也可在库（组件）升级迁移中提供参考。</p><p>如果一个组件被不同类型的业务引用，间接证明它与单一业务解耦，业务入侵少或零入侵。</p><h2 id="_5-faq" tabindex="-1">5. FAQ <a class="header-anchor" href="#_5-faq" aria-label="Permalink to &quot;5. FAQ&quot;">​</a></h2><h3 id="_5-1-统计方案" tabindex="-1">5.1. 统计方案 <a class="header-anchor" href="#_5-1-统计方案" aria-label="Permalink to &quot;5.1. 统计方案&quot;">​</a></h3><p>每天、每个组件库、每个项目、每个组件的使用数目是唯一的，设计了一个唯一 <code>key</code>，即 <code>${date}__${library}__${project}__${component}</code>。</p><p>录入数据的时候，先查询是否有该 <code>key</code>，如果有，则更新使用数目，如果没有，则新增。</p><h3 id="_5-2-统计项目" tabindex="-1">5.2. 统计项目 <a class="header-anchor" href="#_5-2-统计项目" aria-label="Permalink to &quot;5.2. 统计项目&quot;">​</a></h3><p>包含以下组的前端项目：</p><ul><li><code>pmd-mobile</code></li><li><code>pvpesports</code></li><li><code>coecology</code></li><li><code>slolnes</code></li></ul><p>排除了以下无效项目：</p><ul><li><code>pmd-mobile/{app,movie,hippy,tip-flutter,test,demo}/*</code></li><li><code>pmd-mobile/pmd-h5/api</code></li><li><code>pmd-mobile/pmd-h5/frontend-cloud</code></li><li>组件库自身项目</li></ul><h3 id="_5-3-统计分支" tabindex="-1">5.3. 统计分支 <a class="header-anchor" href="#_5-3-统计分支" aria-label="Permalink to &quot;5.3. 统计分支&quot;">​</a></h3><p>各项目的主分支，业务项目基本都是 <code>develop</code>。</p><h3 id="_5-4-统计起始日期" tabindex="-1">5.4. 统计起始日期 <a class="header-anchor" href="#_5-4-统计起始日期" aria-label="Permalink to &quot;5.4. 统计起始日期&quot;">​</a></h3><p>2025.9.26</p><h3 id="_5-5-匹配模式" tabindex="-1">5.5. 匹配模式 <a class="header-anchor" href="#_5-5-匹配模式" aria-label="Permalink to &quot;5.5. 匹配模式&quot;">​</a></h3><p>两种模式</p><ol><li>不按逗号拆分</li><li>按逗号拆分</li></ol><p>第一种可以识别：默认导出、命名空间导出</p><div class="language-js vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang">js</span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span style="--shiki-light:#6A737D;--shiki-dark:#6A737D;">// 统计后面的 press-toast（从路径）</span></span>\n<span class="line"><span style="--shiki-light:#D73A49;--shiki-dark:#F97583;">import</span><span style="--shiki-light:#24292E;--shiki-dark:#E1E4E8;"> PressToast </span><span style="--shiki-light:#D73A49;--shiki-dark:#F97583;">from</span><span style="--shiki-light:#032F62;--shiki-dark:#9ECBFF;"> &#39;press-ui/press-toast/press-toast.vue&#39;</span></span>\n<span class="line"></span>\n<span class="line"><span style="--shiki-light:#D73A49;--shiki-dark:#F97583;">import</span><span style="--shiki-light:#24292E;--shiki-dark:#E1E4E8;"> Toast </span><span style="--shiki-light:#D73A49;--shiki-dark:#F97583;">from</span><span style="--shiki-light:#032F62;--shiki-dark:#9ECBFF;"> &#39;press-ui/common/toast&#39;</span><span style="--shiki-light:#24292E;--shiki-dark:#E1E4E8;">;</span></span></code></pre></div><p>第二种可以识别：具名导出</p><div class="language-js vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang">js</span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span style="--shiki-light:#D73A49;--shiki-dark:#F97583;">import</span><span style="--shiki-light:#24292E;--shiki-dark:#E1E4E8;"> { A, B, C } </span><span style="--shiki-light:#D73A49;--shiki-dark:#F97583;">from</span><span style="--shiki-light:#032F62;--shiki-dark:#9ECBFF;"> &#39;press-ui/common/toast&#39;</span><span style="--shiki-light:#24292E;--shiki-dark:#E1E4E8;">;</span></span></code></pre></div>',40)]))}const m=e(o,[["render",l]]);export{k as __pageData,m as default};
